package expression.generic;import java.util.Objects;public class UncheckedLongMode implements NumberMode<Long> {    @Override    public Long parse(String string) {        return Long.parseLong(string);    }    @Override    public Long add(Long a, Long b) {        return a + b;    }    @Override    public Long subtract(Long a, Long b) {        return a - b;    }    @Override    public Long multiply(Long a, Long b) {        return a * b;    }    @Override    public Long divide(Long a, Long b) {        return a / b;    }    @Override    public Long min(Long a, Long b) {        return Long.min(a, b);    }    @Override    public Long max(Long a, Long b) {        return Long.max(a,b);    }    @Override    public Long negate(Long a) {        return -a;    }    @Override    public int intValue(Long a) {        return a.intValue();    }    @Override    public boolean compare(Long a, Long b) {        return Objects.equals(a, b);    }    @Override    public Long count(Long a) {        return (long)Long.bitCount(a);    }}